INSERT INTO `posts` (`postid`, `post_text`, `post_images`, `posting_date`, `poster_id`, `likes_num`) VALUES
(16, 'I am in love with MyAccount <3', '', '2018-11-19 21:13:32', 54, 0),
(17, 'test test test', '', '2018-11-19 21:46:39', 58, 0),
(19, 'أخيرا وصلنا لليوم دا ❤️', '', '2018-11-20 22:22:20', 100, 0),
(20, 'Awesome work from the IT Web team <3 I love it.', '', '2018-11-20 22:32:27', 67, 0),
(21, '*بتضيف الشابتر كله عندها في الفريندز*', '', '2018-11-20 22:36:58', 67, 0),
(23, 'It takes extraordinary manpower to achieve a great vision in a remarkable period of time. Look around, we are The Leading Community. We are leading and will continue to lead as long as we keep our unyielding wills to do more, to become more.<br />\n<br />\nToday is not about being good, it’s about being the best. Today is about the people that give their all and never get tired of pushing forward to mark AAPG steps as The Leading Community. The people that know for a fact that great things never come out of comfort zones so they work hard day in and day out.<br />\n<br />\nLet’s congratulate the best AAPGians for the October/November Evaluation:<br />\n<br />\n- Mr. Mohamed El Khodry, Best Android Developer<br />\n- Mr. Mahmoud El Mshad, Best Artist<br />\n- Ms. Amira Hassan, Best Content Innovator<br />\n- Mr. Ali Thabet, Best Web Developer<br />\n- Ms. Menna Hamdy, Best Talent Developer<br />\n- Ms. Reham Abd Elsamed, Best Bookworm<br />\n- Mr. Abdullah Allam, Best Crammer<br />\n- Mr. Youssef El Halafawy, Best Deal Hunter<br />\n- Mr. Ahmed Al Anany, Best Editor<br />\n- Ms. Amira Emam, Best Public Speaker<br />\n- Mr. Mohamed Ezz, Best Organizer<br />\n<br />\n-------<br />\nIn addition, we are delighted to celebrate another set of outstanding people that showed us all the definition of teamwork and fascinated our eyes with inspiring products that have taken us many steps forward on our journey to lead.<br />\n<br />\nThe Marketing Coordination is, beyond any doubt, the Best Coordination for this Evaluation.<br />\n<br />\n-------<br />\n“Successful leadership is leading with heart, not just the head.”<br />\n<br />\nThat being said, we shall celebrate a leader that leads with both. One that holds no effort in the attempt to help others and Pave The Impassable.<br />\n<br />\nMs. Esraa Abdullah, Academy El Gama’a Head, is the Best Head for this Evaluation.<br />\n<br />\n-------<br />\nCongratulations to all of us.<br />\n<br />\nWe still have a long way to go. We will just take a little break and get over with the finals first.<br />\n<br />\nGood Luck.', '', '2018-12-29 19:20:31', 63, 0),
(24, '“The more I learn, the more I realize how much I don\'t know.”<br />\nAlbert Einstein', '', '2019-03-06 18:34:30', 144, 0);
